  const [jokeDay, setJokeDay] = useState("");

  const options = () => {
    fetch("https://dad-jokes.p.rapidapi.com/random/joke")
      .then((res) => res.json())
      .then((data) => {
        let randomNum = Math.floor(Math.random() * data.length);
        setJokeDay(data[randomNum]);
      });
  };

  useEffect(() => {
    options();
  }, []);

  return (
    <div className="footer-main">
